import React, { Component } from 'react';

import {Card, CardColumns, Col, Row} from 'react-bootstrap'

import Pic1 from '../img/NY17.jpeg'
import Pic2 from '../img/NY18.jpeg'
import Pic3 from '../img/NY19.jpeg'
import RealCard from './RealCard'

class WorkPage extends Component {
    constructor(props){
        super(props);
    }

    render(){
        return (
            <Row style={{minHeight:"80vh" ,justifyContent:"center",alignItems:"center"}}>
            <Col style={{borderColor:"white"}} xs={8}>
            <CardColumns>
            <RealCard
            src={Pic1}
            alt="Card1"
            title="New York 1"
            text="This is a Test"
            />
            <RealCard
            src={Pic2}
            alt="Card2"
            title="New York 2"
            text="This is a Test"
            />
            <RealCard
            src={Pic3}
            alt="Card3"
            title="New York 3"
            text="This is a Test"
            />
            </CardColumns>
            </Col>
            </Row>
        );
    }
};

export default WorkPage;
